import jakarta.persistence.*;
import lombok.*;

@Entity
@Table(name = "TPJ_EMPLOYEE")
@Data
public class TpjEmployee {
    @Id
    @GeneratedValue(strategy = GenerationType.IDENTITY)
    private Long id;

    @Column(name = "REGULAR_YN", nullable = false, length = 1)
    private String regularYn;

    @Column(name = "EMP_NAME", nullable = false, length = 50)
    private String empName;

    @Column(name = "USER_ID")
    private String userId;

    @Column(name = "DEPT_CODE", nullable = false, length = 10)
    private String deptCode;

    @Column(name = "EMP_KEY", unique = true, nullable = false, length = 10)
    private String empKey;
}

